import { API } from "../../config/api";
import { useQuery } from "react-query";
import CardPopular from "../../compnents/card/CardPopular";

//useQuery = method GET
//useMutation = method POST, PUT, PATCH & DELETE

const Multer = () => {
	const {
		data: productData,
		error: productError,
		loading: productLoading,
		refetch: productRefetch,
	} = useQuery("productsCache", async () => {
		return API.get("/products");
	});

	return (
		<div>
			<div className="mt-3 row">
				<div className="row py-3">
					<div className="my-2 col-12">
						<h2>Popular Restaurant</h2>
					</div>

					{productLoading ? (
						<tr>
							<td colSpan="4">Loading Data</td>
						</tr>
					) : (
						productData?.data?.data?.products?.map((product, index) => (
							<CardPopular product={product} index={index} key={product.id} />
						))
					)}
				</div>
				<table className="table table-striped table-hovered">
					<thead>
						<tr>
							<th>No</th>
							<th>Name</th>
							<th>Image</th>
							<th>Action</th>
						</tr>
					</thead>
					<tbody></tbody>
				</table>
			</div>
		</div>
	);
};

export default Multer;
